import Link from 'next/link';

function Header() {
  return (
    <>
      <nav className="flex justify-between h-16 border items-center">
        <Link href="/">
          <a className="text-red">Logo</a>
        </Link>
        <ul className="flex items-center">
          <NavLink href="/writing" className="mr-6">
            Writing
          </NavLink>
          <NavLink href="/about">About</NavLink>
        </ul>
      </nav>
    </>
  );
}

function NavLink(props) {
  const { href, className, children, ...rest } = props;
  return (
    <Link href={href}>
      <li
        className={`hover:text-teal-900 cursor-pointer ${className}`}
        {...rest}
      >
        {children}
      </li>
    </Link>
  );
}

export default Header;
